import React, { Component } from 'react';
import Head from '../components/Head';

export default class Classes extends Component {


	constructor(props) {
		super(props);
		this.state = {
			students: []
		}
		axios.get(`/classes`)
			.then(res => {
				this.setState({ students: res.data });
			}).catch(error => {
				console.log(error);
			});
	}
	render() {
		return (
			<div>
				<Head />
				<div id="body">
					<table>
						<thead>
							<tr>
								<td>name</td>
								<td>password</td>
								<td>class</td>
							</tr>
						</thead>
						<tbody>
							{this.state.students.map((stud)=><tr  key={stud.id}>
								<td>{stud.name}</td>
								<td>{stud.password}</td>
								<td>{stud.class}</td>
							</tr>)}
							</tbody>
					</table>
				</div>
			</div>
		);
	}
}
